import React from 'react';
import Personita1 from '../../assets/img/Personita1.svg'
import LogoCiti from '../../assets/img/logociti.svg'


const Home = () => {
    return(
        <main>
         <figure>
             <img src={LogoCiti} alt="logo-citi"/>
         </figure>

         <div className="row">
          <img src={ Personita1 } alt="persona-1"/>
          <p></p>
        <div>
   <p>hola</p>
        </div>
        </div>

        </main>
    )
}

export default Home;
